import React from 'react';
import { postsData } from '../postsData.js';

export default function PostContainer() {
    return (
        <div>
            {
                postsData.map(post => (
                    <div key={post.id}>
                        <h2>{post.heading}</h2>
                        <p>{post.description}</p>
                        <p>Likes: {post.likes_count}</p>
                    </div>
                ))
            }
        </div>
    );
}
